import Note from "./Note"



const Project = props => {
    const notes = props.notes;
    console.log("notes: ", notes);
    return (
    <div>
            <h1>{props.project}</h1>
            <div>{
                Object.keys(notes).map((note,i) => {
                    //console.log("text: ", notes[note].text);
                    <Note key={i} type={notes[note].type} text={notes[note].text} title={notes[note].title} url={notes[note].url}/>;
                })
            }
            </div>
    </div>)
}




export default Project;
